const Moves = (props) => {
    let o = {}


    const test = props.moves.reduce((total, currentValue) => {
        if(typeof total !== 'object'){
            total = {}
        }
        currentValue.version_group_details.forEach(move => {
            total[move.version_group.name].push(move) || (total[move.version_group.name] = [])
        })

    })

    return (
        <div>

        </div>
    )
}

export default Moves
